import { Button, Grid, Typography } from "@mui/material";
import CourseCard1 from '../../assets/course-card1.png';

function LatestNewsCard(props) {

  return (
    <Grid container className="invitationCard latestNewsCard">
      <Grid item xs={12}>
        <div className="invitationCardLeft">
          <div className="invitationCardLeftImage">
            <img alt='course-card' width='150' src={CourseCard1} />
          </div>
          <div className="invitationCardLeftText latestNewsCardLeftText">
            <Typography variant='h6'>
                Amet minim mollit non deserunt ullamco 
            </Typography>
            <Typography variant='span'>
                May 15, 2022
            </Typography>
          </div>
        </div>
      </Grid>
    </Grid>
  );
}

export default LatestNewsCard;
